import React, { useState } from 'react';

const PokemonList = ({ pokemon }) => {

  const [pokemonData, setPokemonData] = useState()
  return (
    <div>
      {pokemon.map(p => (
        <div onClick={pokemonData} key={p}>{p}</div>
      ))}
    </div>
  )

};

export default PokemonList;
